import React from "react";
import TableBody from "./TableBody";
import TableHead from "./TableHead";

const Table = () => {
   return
   <React.Fragment>
      <table>
         <TableHead />
         <TableBody />
      </table>
   </React.Fragment>;
};

export default Table;
